import FileSaver from 'file-saver';

const saveFile = () => {
    FileSaver.saveAs(
      process.env.REACT_APP_CLIENT_URL + "/resources/cv.pdf",
      "CV.pdf"
    );


    return (
        <button className="cv" onClick={saveFile}>
            Download CV
        </button>
    );
};
    export default saveFile;
